import React from "react";
import MainLayout from "../layout/MainLayout";

const FinishPage = () => {
  return (
    <MainLayout>
      <main className="px-32 flex flex-col gap-4">
        <h1 className="font-bold text-[3rem]">Finish Order</h1>
      </main>
    </MainLayout>
  );
};

export default FinishPage;
